insert  into `hs_member_type`(`usertype_id`,`usertype_name`,`usertype_description`) values 
(1,'普通会员','（1）送仙人掌饮料一杯\n（2）直推vip会员按实际支付现金的5％作为仙人掌币\n（3）推高级别会员(金卡会员和钻石卡会员)直接升级为该级别会员,并且直推奖按该高级别奖励百分比作为仙人掌币\n（4）仙人掌币(商城购物/可互转/可提现)'),
(2,'VIP会员','（1）送肠道排毒1次价值1500元\n（2）送仙人掌产品价值约1500元礼包。\n（3）送代金卷1500元（商城购物使用）\n（4）同级别直推奖按实际支付现金的10％作为仙人掌币\n（5）推高级别会员直接升级为该级别会员,并且直推奖按该高级别奖励百分比作为仙人掌币\n（6）推荐消费累计1万5，一年后退回消费本金1500元\n（7）需支付1,500元或[现金(1300)+仙人掌币(200)]\n（8）送10万左右汽车一辆\n（9）仙人掌币(商城购物/可互转/可提现)'),
(3,'金卡会员','（1）送肠道排毒或肝胆排毒6次价值15000元左右。\n（2）送仙人掌产品价值¥15,000元左右。\n（3）送代金券¥15,000元（商城购物使用）\n（4）同级别直推奖按实际支付现金的15%作为仙人掌币\n（5）推高级别会员直接升级为该级别会员,并且直推奖按该高级别奖励百分比作为仙人掌币\n（6）推荐累计15万元，一年后退回消费本金15000元。\n（7）需支付15,000元或[现金(13000)+仙人掌币(2000)]\n（8）送20万左右汽车一辆\n（9）仙人掌币(商城购物/可互转/可提现)'),
(4,'钻石卡会员','（1）送肠道排毒或肝胆排毒20次\n（2）送仙人掌产品价值¥30,000元。\n（3）送代金卷¥30,000元（商城购物使用）。\n（4）同级别直推奖按实际支付现金的20%作为仙人掌币\n（5）推荐消费累计30万，一年后退回消费本金30,000元\n（6）需支付30,000元或[现金(26000)+仙人掌币(4000)]\n（7）送30万左右汽车一辆\n（8）仙人掌币(商城购物/可互转/可提现)');
